import React, { useState } from 'react';

// Cute Bear Sticker Component
const BearSticker = () => (
  <svg width="180" height="180" viewBox="0 0 200 200" style={{ animation: 'float 3s ease-in-out infinite' }}>
    {/* Bear face */}
    <circle cx="100" cy="110" r="70" fill="#C19A6B" />
    {/* Left ear */}
    <circle cx="60" cy="60" r="30" fill="#C19A6B" />
    <circle cx="60" cy="60" r="18" fill="#E8C5A0" />
    {/* Right ear */}
    <circle cx="140" cy="60" r="30" fill="#C19A6B" />
    <circle cx="140" cy="60" r="18" fill="#E8C5A0" />
    {/* Face highlight */}
    <circle cx="100" cy="120" r="45" fill="#E8C5A0" />
    {/* Eyes */}
    <circle cx="80" cy="105" r="8" fill="#4A4A4A" />
    <circle cx="120" cy="105" r="8" fill="#4A4A4A" />
    {/* Nose */}
    <ellipse cx="100" cy="125" rx="12" ry="10" fill="#3A3A3A" />
    {/* Smile */}
    <path d="M 85 135 Q 100 145 115 135" stroke="#3A3A3A" strokeWidth="3" fill="none" strokeLinecap="round" />
    {/* Blush */}
    <circle cx="65" cy="125" r="12" fill="#FFB6C1" opacity="0.6" />
    <circle cx="135" cy="125" r="12" fill="#FFB6C1" opacity="0.6" />
  </svg>
);

// Cute Rose Sticker Component
const RoseSticker = () => (
  <svg width="180" height="180" viewBox="0 0 200 200" style={{ animation: 'float 3s ease-in-out infinite', animationDelay: '0.5s' }}>
    {/* Stem */}
    <rect x="95" y="100" width="10" height="80" fill="#6B8E23" rx="5" />
    {/* Leaves */}
    <ellipse cx="85" cy="130" rx="20" ry="12" fill="#7CB342" transform="rotate(-30 85 130)" />
    <ellipse cx="115" cy="150" rx="20" ry="12" fill="#7CB342" transform="rotate(30 115 150)" />
    {/* Rose petals - outer */}
    <circle cx="100" cy="80" r="35" fill="#FF6B9D" opacity="0.7" />
    {/* Rose petals - middle layer */}
    <ellipse cx="90" cy="75" rx="25" ry="30" fill="#FF8AB5" transform="rotate(-20 90 75)" />
    <ellipse cx="110" cy="75" rx="25" ry="30" fill="#FF8AB5" transform="rotate(20 110 75)" />
    {/* Rose center */}
    <circle cx="100" cy="70" r="18" fill="#FF3D7F" />
    <circle cx="100" cy="70" r="12" fill="#FF5C94" />
    {/* Highlights */}
    <ellipse cx="95" cy="65" rx="6" ry="8" fill="#FFB6D9" opacity="0.8" />
  </svg>
);

// Cute Crown Sticker Component
const CrownSticker = () => (
  <svg width="180" height="180" viewBox="0 0 200 200" style={{ animation: 'float 3s ease-in-out infinite', animationDelay: '1s' }}>
    {/* Crown base */}
    <path d="M 40 120 L 50 80 L 75 100 L 100 60 L 125 100 L 150 80 L 160 120 Z" fill="#FFD700" />
    <rect x="40" y="120" width="120" height="25" fill="#FFD700" rx="5" />
    {/* Crown rim */}
    <rect x="40" y="140" width="120" height="10" fill="#FFA500" rx="3" />
    {/* Jewels */}
    <circle cx="70" cy="110" r="8" fill="#FF1493" />
    <circle cx="100" cy="90" r="10" fill="#1E90FF" />
    <circle cx="130" cy="110" r="8" fill="#FF1493" />
    {/* Highlights on jewels */}
    <circle cx="68" cy="108" r="3" fill="#FFB6D9" opacity="0.8" />
    <circle cx="98" cy="88" r="4" fill="#87CEEB" opacity="0.8" />
    <circle cx="128" cy="108" r="3" fill="#FFB6D9" opacity="0.8" />
    {/* Crown pattern */}
    <circle cx="60" cy="130" r="4" fill="#FFA500" />
    <circle cx="100" cy="130" r="4" fill="#FFA500" />
    <circle cx="140" cy="130" r="4" fill="#FFA500" />
  </svg>
);

// Crying Sticker Component
const CryingSticker = () => (
  <svg width="180" height="180" viewBox="0 0 200 200" style={{ animation: 'float 3s ease-in-out infinite', animationDelay: '1s' }}>
    {/* Face */}
    <circle cx="100" cy="100" r="70" fill="#FFE5B4" />
    {/* Crying eyes */}
    <circle cx="75" cy="90" r="8" fill="#333" />
    <circle cx="125" cy="90" r="8" fill="#333" />
    {/* Closed crying eyes effect */}
    <path d="M 65 85 Q 75 80 85 85" stroke="#333" strokeWidth="4" fill="none" strokeLinecap="round" />
    <path d="M 115 85 Q 125 80 135 85" stroke="#333" strokeWidth="4" fill="none" strokeLinecap="round" />
    {/* Tears */}
    <ellipse cx="65" cy="100" rx="6" ry="12" fill="#87CEEB" opacity="0.8" />
    <ellipse cx="65" cy="120" rx="5" ry="8" fill="#87CEEB" opacity="0.6" />
    <ellipse cx="135" cy="100" rx="6" ry="12" fill="#87CEEB" opacity="0.8" />
    <ellipse cx="135" cy="120" rx="5" ry="8" fill="#87CEEB" opacity="0.6" />
    {/* Sad mouth */}
    <path d="M 75 125 Q 100 115 125 125" stroke="#333" strokeWidth="4" fill="none" strokeLinecap="round" />
    {/* Blush */}
    <circle cx="55" cy="110" r="12" fill="#FFB6D9" opacity="0.5" />
    <circle cx="145" cy="110" r="12" fill="#FFB6D9" opacity="0.5" />
  </svg>
);

// Begging Sticker Component  
const BeggingSticker = () => (
  <svg width="180" height="180" viewBox="0 0 200 200" style={{ animation: 'float 3s ease-in-out infinite', animationDelay: '1s' }}>
    {/* Face */}
    <circle cx="100" cy="90" r="60" fill="#FFDAB9" />
    {/* Puppy eyes */}
    <circle cx="80" cy="85" r="12" fill="#333" />
    <circle cx="120" cy="85" r="12" fill="#333" />
    {/* Sparkles in eyes */}
    <circle cx="78" cy="82" r="4" fill="#FFF" />
    <circle cx="118" cy="82" r="4" fill="#FFF" />
    {/* Eyebrows raised (begging) */}
    <path d="M 65 70 Q 75 65 85 70" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    <path d="M 115 70 Q 125 65 135 70" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    {/* Small pleading mouth */}
    <ellipse cx="100" cy="105" rx="8" ry="6" fill="#333" />
    {/* Hands together (praying/begging) */}
    <ellipse cx="100" cy="140" rx="35" ry="25" fill="#FFDAB9" />
    <path d="M 85 140 L 100 130 L 115 140" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    <circle cx="90" cy="145" r="8" fill="#FFDAB9" />
    <circle cx="110" cy="145" r="8" fill="#FFDAB9" />
    {/* Blush */}
    <circle cx="60" cy="95" r="10" fill="#FFB6D9" opacity="0.6" />
    <circle cx="140" cy="95" r="10" fill="#FFB6D9" opacity="0.6" />
    {/* Sparkles around (pleading effect) */}
    <text x="55" y="75" fontSize="20" fill="#FFD700">âœ¨</text>
    <text x="135" y="75" fontSize="20" fill="#FFD700">âœ¨</text>
  </svg>
);

// Success page stickers - Cute cats with hearts
const CatWithHeart = ({ delay = 0 }) => (
  <svg width="160" height="160" viewBox="0 0 200 200" style={{ animation: 'bounce 1s ease-in-out infinite', animationDelay: `${delay}s` }}>
    {/* Cat head */}
    <circle cx="100" cy="100" r="60" fill="#E0E0E0" />
    {/* Left ear */}
    <path d="M 55 60 L 45 20 L 75 55 Z" fill="#E0E0E0" />
    <path d="M 58 55 L 52 30 L 72 58 Z" fill="#FFB6C1" />
    {/* Right ear */}
    <path d="M 145 60 L 155 20 L 125 55 Z" fill="#E0E0E0" />
    <path d="M 142 55 L 148 30 L 128 58 Z" fill="#FFB6C1" />
    {/* Eyes */}
    <circle cx="80" cy="95" r="5" fill="#333" />
    <circle cx="120" cy="95" r="5" fill="#333" />
    {/* Happy closed eyes effect */}
    <path d="M 75 92 Q 80 88 85 92" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    <path d="M 115 92 Q 120 88 125 92" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    {/* Nose */}
    <circle cx="100" cy="105" r="4" fill="#FF69B4" />
    {/* Smile */}
    <path d="M 85 115 Q 100 125 115 115" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    {/* Blush */}
    <circle cx="65" cy="110" r="10" fill="#FFB6D9" opacity="0.6" />
    <circle cx="135" cy="110" r="10" fill="#FFB6D9" opacity="0.6" />
    {/* Heart */}
    <path d="M 100 135 L 90 145 Q 85 150 85 155 Q 85 162 92 165 Q 100 168 100 168 Q 100 168 108 165 Q 115 162 115 155 Q 115 150 110 145 Z" fill="#FF3D7F" />
  </svg>
);

export default function App() {
  const [noCount, setNoCount] = useState(0);
  const [yesPressed, setYesPressed] = useState(false);
  const [noPosition, setNoPosition] = useState({ x: 0, y: 0 });

  const phrases = [
    "No",
    "Are you sure?",
    "Pookie please ðŸ¥º",
    "Don't do this to me ðŸ¥º",
    "You're breaking my heart ðŸ˜¢",
    "I'm gonna cry... ðŸ˜­",
    "Think about it!",
    "Are you absolutely certain?",
    "This could be a mistake!",
    "Really??",
    "Pwease ðŸ¥º",
    "I'll be sad...",
    "You can't say no!",
    "Give me a chance!",
    "Don't be like that ðŸ˜¢",
    "Please please please!",
    "I'm begging you!",
    "Just say yes!",
    "Come on!",
    "Why not? ðŸ¥º",
    "PLEASE SAY YES!",
    "I won't stop asking!",
    "Never gonna give up!",
    "Say yes already! ðŸ’•"
  ];

  const getNoButtonText = () => {
    return phrases[Math.min(noCount, phrases.length - 1)];
  };

  const handleNoHover = () => {
    setNoCount(noCount + 1);
    // Move button ANYWHERE on the screen
    const newX = Math.random() * (window.innerWidth - 300) - (window.innerWidth / 2 - 150);
    const newY = Math.random() * (window.innerHeight - 200) - (window.innerHeight / 2 - 100);
    setNoPosition({ x: newX, y: newY });
  };

  if (yesPressed) {
    return (
      <div style={{
        minHeight: '100vh',
        background: '#ffc9d9',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily: '"Quicksand", sans-serif',
        position: 'relative',
        overflow: 'hidden'
      }}>
        {/* Confetti */}
        {[...Array(60)].map((_, i) => (
          <div
            key={i}
            style={{
              position: 'absolute',
              width: '12px',
              height: '12px',
              background: ['#ff6b9d', '#ffd93d', '#6bcf7f', '#4d9fff', '#ff8364', '#c780e8'][i % 6],
              left: `${Math.random() * 100}%`,
              top: '-10px',
              animation: `fall ${2 + Math.random() * 2}s linear infinite`,
              animationDelay: `${Math.random() * 3}s`,
              borderRadius: Math.random() > 0.5 ? '50%' : '2px',
              transform: `rotate(${Math.random() * 360}deg)`
            }}
          />
        ))}

        <style>{`
          @import url('https://fonts.googleapis.com/css2?family=Quicksand:wght@400;500;600;700&display=swap');

          @keyframes fall {
            to {
              transform: translateY(100vh) rotate(720deg);
            }
          }

          @keyframes bounce {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.1); }
          }

          @keyframes float {
            0%, 100% { transform: translateY(0px); }
            50% { transform: translateY(-15px); }
          }
        `}</style>

        <div style={{
          display: 'flex',
          gap: '30px',
